/* disable shorts */
ytd-rich-shelf-renderer[is-shorts] {
  display: none;
}

ytd-feed-filter-chip-bar-renderer {
    display: none;
}

#notification-count {
    display: none;
}

path[fill="#FF0000"] {
    fill: var(--yt-red);
}

ytd-watch-flexy[theater] #player-theater-container.ytd-watch-flexy, ytd-watch-flexy[fullscreen] #player-theater-container.ytd-watch-flexy {
  background: var(--sag-bg-200);
}

#content-bg,
body {
  background: var(--sag-bg-500);
}

#content {
  background: var(--sag-bg-500);
  color: white;
}

#headerwrap,
.b-top-menu__background {
  background: var(--sag-bg-700);
}

.b-top-menu__background::before {
  content: none;
}

#headerwrap > div {
  display: flex;
  justify-content: center;
}

#headerright {
  display: none;
}

#sharebar {
  display: none !important;
}
/*
#sidebar,
#menuwrap,
#sharebar,
.article-box,
.after-article,
#footer,
#c2c44,
#wrapper > *:not(#content),
#sitebuilder-wrapper {
  display: none !important;
}*/

/* Menu Bar */
#menuwrap {
  background-color: var(--sag-bg-700);
}

#linklist li.menulink a.linknode:hover, li.menulink span:hover {
  background-color: var(--sag-green-dark);
}

#cse-search-box > div > input[type="text"] {
  filter: invert(100%) contrast(60%);
  mix-blend-mode: lighten;
}

#search {
  background-color: var(--sag-border);
}

#search input[type="submit"] {
  background-color: var(--sag-green-dark);
}

#footer,
#main,
#sidebar-wrap,
#content {
  border-color: var(--sag-border);
}

article {
  border-style: solid;
  border-color: var(--sag-border);
}

article {
  color: white;
}

article a,
#sidebar a,
#litemenu a {
  color: #67cbff;
}

article.important header a::before {
  background-color: var(--sag-bg-900);
}

article.full::after {
  content: none
}

article .details,
article .details a,
article.full .author,
blockquote, #sidebar aside header, .article-box header, #about-author header, .wide-article-box header, #sidebar aside {
  color: #ddd;
}

/* Main Website Static Nav */
.pagination {
  display: flex;
  justify-content: center;
  align-items: center;
  margin-top: 16px;

  visibility: hidden;

  font-size: 0.8rem;

  transform: translateX(-36px);
}

.pagination a, .pagination a:hover, .pagination a:visited, .pagination span {
  display: block;

  font-weight: bold;

  padding: 2px 8px;
  border: none;
  border-radius: 0;
  margin: 0 2px;

  background: var(--sag-bg-900);
  color: white;

  visibility: visible;
}

.pagination span {
  background: #3498DB !important;
}

/* Forums */
a,
a:active,
a:visited,
.b-link,
.ui-widget-content a {
  color: #67cbff;
}

a:focus,
input:focus,
textarea:focus,
button:focus,
select:focus,
.js-link:focus,
.js-button:focus,
.b-button:focus,
.ui-state-focus,
.custom-dropdown:focus,
.cke_dialog_body .cke_dialog_contents .b-button:focus {
  outline: none;
}

.page-title-widget .module-title,
.page-title-widget .module-title h1 {
  color: #fff;
}

#notices, .breadcrumbs-wrapper, .b-top-background__header-mainnav-subnav, #outer-wrapper > #wrapper > #footer {
  display: none;
}

#canvas-layout-full > div:nth-child(1) {
  display: none;
}

#canvas-layout-full > div:nth-child(2) > div,
#canvas-layout-full > div:nth-child(2) > div #widget_19 > .widget-header,
.b-userinfo,
.b-post-control__label {
  background: none;
  color: #fff !important;
}


#canvas-layout-full > div:nth-child(2) > div #widget_175 {
  display: none;
}

#canvas-layout-full #widget_20 > div:nth-child(2),
#footer-copyright {
  display: none;
}

#thread-view-tab > .conversation-toolbar-wrapper,
.b-sharing-menu,
.b-meter,
.b-userinfo__additional-info-block {
  display: none;
}

#thread-view-tab .conversation-content > ul > li {
  background: var(--sag-bg-700);
  color: #fff;
}

.b-post__body {
  background: var(--sag-bg-700) !important;
}

/* SVG charts */
.content > div > img[type="image/svg+xml"] {
  filter: invert(100%) hue-rotate(180deg);
}

/* Forum Static Nav */
.pagenav-container {
  display: flex;
  justify-content: center;
  margin-top: 16px;
}
.js-pagenav {
  margin: auto;
  float: none;
}

body .b-button,
body .b-button:link {
  border-radius: 0;
}

.b-button--secondary,
.b-button--secondary:link,
.b-button--secondary:visited,
.cke_dialog_body .cke_dialog_contents .b-button--secondary,
.cke_dialog_body .cke_dialog_contents .b-button--secondary:link,
.cke_dialog_body .cke_dialog_contents .b-button--secondary:visited {
  background: var(--sag-bg-900);
}

.b-button--primary:hover,
.b-button--primary,
.b-button--primary:link {
  background: #3498DB !important;
}

.bbcode_container .bbcode_quote {
  background: var(--sag-bg-800);
}

span[style~="color:#000000"] {
  color: white !important;
}

